import React, { Component } from "react";
import { Carousel, Button, ButtonToolbar } from "react-bootstrap";
import tree from "./image/marketplace.jpg";
import { FaArrowsAlt, FaArrowAltCircleRight, FaUserPlus } from "react-icons/fa";
import "./style.css";
export default class Carosel extends Component {
  render() {
    return (
      <div>
        <Carousel controls={false}>
          <Carousel.Item>
            <img
              className="d-block w-100 image-responsive"
              style={img}
              src={tree}
              alt="Third slide"
            />
          </Carousel.Item>
        </Carousel>

        <h1
          className="text-center mt-5 mb-5 text-dark"
          style={{ fontSize: "23px" }}
        >
          Featured Products
        </h1>

        <div className="container">
          <div className="row ml-5">
            <div className="col-md-4">
              <h1>One</h1>
            </div>

            <div className="col-md-4">
              <h1>two</h1>
            </div>

            <div className="col-md-4">
              <h1>Three</h1>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

var img = {
  position: "cover",
  height: "400px"
};
